import React, { Component,useState,useEffect } from "react";
import MyCarousal from "../../components/my-carousal/my-carousal.component";
import MyTitleMessage from "../../components/title-message/title-message.component";

//profile Picture
import ExampleComponent from "react-rounded-image";
import profilePictureImage from '../../assests/img/profile/linkedin-photo.jfif';
import styles from  './home.module.css';
import ProfilePicture from "../../components/profilePicture/profilePicture.component";


//For about section Parallax Effect
import { Parallax, ParallaxLayer } from 'react-spring/addons'

// Little helpers ...
const url = (name, wrap = false) => `${wrap ? 'url(' : ''}https://awv3node-homepage.surge.sh/build/assets/${name}.svg${wrap ? ')' : ''}`
const Pink = ({ children }) => <span style={{ color: '#FF6AC1' }}>{children}</span>
const Yellow = ({ children }) => <span style={{ color: '#EFF59B' }}>{children}</span>
const Lightblue = ({ children }) => <span style={{ color: '#9AEDFE' }}>{children}</span>
const Green = ({ children }) => <span style={{ color: '#57EE89' }}>{children}</span>
const Blue = ({ children }) => <span style={{ color: '#57C7FF' }}>{children}</span>
const Gray = ({ children }) => <span style={{ color: '#909090' }}>{children}</span>


//==================================


class Home extends Component {

    render() {
        return (
            <div className={styles.Home}>
                <MyCarousal />
                <div className={styles.Content}>
                    <ExampleComponent
                        image={profilePictureImage}
                        roundedColor="#FFF"
                        imageWidth="200"
                        imageHeight="200"
                        roundedSize="10"
                    />
                </div>
                <MyTitleMessage />
            </div>
        );
    }
}

export default Home;
